import React from 'react';
import Navbar from '../navbar';
import './cart.css';

 function Checkout() {
  return (
     <div className="checkoutpage">
            <header className="checkoutheader">
                      <Navbar/>
                      <div className="checkoutpagebox">
                             <h1>Checkout Page</h1>
                      </div>
            </header>
     </div>
  );
}
export default Checkout;
